import React from 'react';

const Sidebar = ({ notes }) => {
  return (
    <div>
      <ul className="bg-black max-w-[300px] mt-20 p-5 rounded-2xl">
        <h1 className="text-2xl mb-4">Notes</h1>
        {notes &&
          notes.map((note) => {
            return (
              <li>
                <h1 className="font-cairo text-xl cursor-pointer hover:bg-gray-900 bg-red-800 p-2 my-2 rounded-lg">{note.title}</h1>
              </li>
            );
          })}
      </ul>
    </div>
  );
};

export default Sidebar;
